import { gql } from 'apollo-boost';

// Creating a new user through sign up
const newUserMutation = gql`
  mutation addUser($firstName: String, $lastName: String, $email: String, $password: String, 
    $user_type: String,$restaurant_name:String) {
      addUser(firstName: $firstName, lastName: $lastName, email: $email, password: $password,
       user_type: $user_type,restaurant_name:$restaurant_name) {
      firstName
      lastName
      email
      user_type
      phone
      restaurant_name
      zipcode
       }
      }
`;

// Enrolling into a course
const enrollCourse = gql`
  mutation enrollCourse($email: String, $id: String) {
    enrollCourse(email: $email, id: $id) {
      email
      id
    }
  }
`;

// Creating a new course - by faculty
const createCourse = gql`
  mutation createCourse(
    $id: String
    $courseName: String
    $facultyEmail: String
    $description: String
    $department: String
    $room: String
    $capacity: Number
    $waitlist: Number
    $term: String
  ) {
    createCourse(
      id: $id
      courseName: $courseName
      facultyEmail: $facultyEmail
      description: $description
      department: $department
      room: $room
      capacity: $capacity
      waitlist: $waitlist
      term: $term
    ) {
      facultyEmail
      id
    }
  }
`;

// Updating user profile details
const updateUserName = gql`
  mutation updateUser( $email: String,
    $firstName: String, $lastName: String)
     {  updateUserName(
      email: $email
      firstName : $firstName,
      lastName : $lastName
    ) {
      email
      firstName
      lastName
    }
  }
`;

export { newUserMutation,updateUserName };
